import React from 'react';
import { Link } from "@reach/router";

import './App.css';

let footerImg = {
  imageUrl2:"https://lh3.googleusercontent.com/d/1ZsRHQ_cl05QEypsodoCXQDADVndco0Cb=w686-h228-n?authuser=0",
  imageUrl3:"https://lh3.googleusercontent.com/d/1na4PqSWAwoAlDBZbeAAykGw99WPQ5FGo=w686-h228-n?authuser=0",
  imageUrl4:"https://lh3.googleusercontent.com/d/1Nt42rQ6PaQcw3m6-OVj7YGSp6RIIHXiA=w686-h228-n?authuser=0"
}

function Tour(props) {
  return (
    <div className="background-blue">
      <h1>Tour</h1>
      <ul>
        {[ 
      <Link to='/tour'><img alt="" src={footerImg.imageUrl2} /><br/>ZKM-Tour</Link>, 
      <Link to='/team'><img alt="" src={footerImg.imageUrl3} /><br/>Landschaften</Link>, 
      <Link to='/tour3'><img alt="" src={footerImg.imageUrl4} /><br/>Impressionistische Landshaften</Link>].map(tour =>
          <li>
            <Link to={`/${tour}`}>{tour}</Link>
          </li>)}
      </ul>

{/*<div className="tourImg">
